import React, { useEffect, useState } from 'react';
import ModelDetails from './ModelDetails';
import Top_Bar from "./Top-bar";
import EditModelForm from './EditModelForm';
import DeployConfirmForm from "./DeployConfirmForm";
import SideMenu from "./Side-menu";
import axios from "axios";
import {useNavigate} from "react-router-dom";
import { io } from 'socket.io-client';

const socket = io('http://127.0.0.1:5000');

const ModelList = () => {
  const [models, setModel] = useState([]);
  const [selectedModel, setSelectedModel] = useState(null);
  const [isEditModalOpen, setEditModalOpen] = useState(false);
  const [isDeployModalOpen, setDeployModalOpen] = useState(false);
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [message, setMessage] = useState('');
  const [isLoading, setIsLoading] = useState(false);
  const [modelStatus, setModelStatus] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    // Fetch tasks from Flask backend using Axios
    axios.get('http://127.0.0.1:5000/viewModel')
      .then(response => {
        setModel(response.data);
        console.log(response.data);
      })
      .catch(error => {
        console.error('Error fetching pulling:', error);
      });

    // Listen for task status updates from Socket.IO
    socket.on('model_done', (data) => {
      console.log('Model trained completed:', data);
      setModelStatus(prevTasks => ({
        ...prevTasks,
        [data.model]: { status: data.status}
      }));
    });

    socket.on('model_error', (data) => {
      console.log('Model trained Failed:', data);
      setModelStatus(prevTasks => ({
        ...prevTasks,
        [data.model]: { error: data.error }
      }));
    });

    // Cleanup on component unmount
    return () => {
      socket.off('model_done');
      socket.off('model_error');
    };

  }, []);

  const handleDeployModel = (model) => {
      setDeployModalOpen(true);
      setSelectedModel(model);
  }

  const handleCloseDeployModal = () => {
    setDeployModalOpen(false);
    setSelectedModel(null);
  };

  const handleViewDetails = (model) => {
    setMessage(null);
    setSelectedModel(model);
    setIsModalOpen(true);
  };

  const handleCloseModal = () => {
    setMessage(null);
    setIsModalOpen(false);
    setSelectedModel(null);
  };

  const handleEditDetails = async (model) => {
      setMessage(null);
      setSelectedModel(model);
      setEditModalOpen(true);
  }

  const handleCloseEditModal = () => {
    setMessage(null);
    setEditModalOpen(false);
    setSelectedModel(null)
  };

  const handleDelete = async (model) => {
    try {
      setIsLoading(true); // Show loading state
      const response = await axios.delete('http://127.0.0.1:5000/deleteModel', {
        headers: {
          'Content-Type': 'application/json',
        },
        params: {
          id: model.id
        }

      }, {withCredentials: true});

      setMessage(response.data.message);
      console.log('API response message:', response.data.message);

      if (response.status === 200) {
        setModel((prevModel) =>
        prevModel.filter(m => m.id !== model.id)
      );
        alert('The model deleted successfully.');
        navigate('/model');
      }
  } catch (error) {
      alert('The model deleted unsuccessfully.');
      console.error('Error response:', error.response);
  } finally {
      setIsLoading(false); // Hide loading state
  }
};

  return (
      <div className="model-page">
        <Top_Bar title="Trained Model"/> {/* Use the top bar here */}
        <tr>
          <td>
            <SideMenu/>
          </td>
          <td>
            <div className="model-list">
              {models.length === 0 ? (
                  <h1>No available model</h1>
              ) : (
                  models.map(model => (
                      <div key={models.id} className="models-card">
                        <h3>{model.name}</h3>
                        <p>{model.description}</p>
                        <button onClick={() => handleViewDetails(model)}>
                          View Details
                        </button>
                        <button onClick={() => handleEditDetails(model)}>
                          Edit
                        </button>
                        <button onClick={() => handleDeployModel(model)}>
                          Deploy
                        </button>
                        <button onClick={() => handleDelete(model)} disabled={isLoading}>
                          {isLoading ? 'Deleting...' : 'Delete'}
                        </button>
                      </div>
                  ))
              )}
              {isModalOpen && (
                  <ModelDetails config={selectedModel} onClose={handleCloseModal}/>
              )}

              {modelStatus && (
                  <div className="model-status">
                    <h4>Task ID: {modelStatus.model}</h4>
                    <p>
                      {modelStatus.status !== null ? `Status: ${modelStatus.status}` :
                          (modelStatus.error !== null ? `Error: ${modelStatus.error}` :
                           'Training...' )}
                    </p>
                  </div>
              )}
            </div>
          </td>
        </tr>

        {isEditModalOpen && (
            <div className="modal">
            <EditModelForm model={selectedModel} onClose={handleCloseEditModal} />
        </div>
      )}
        {isDeployModalOpen && (
        <div className="deployModal">
          <DeployConfirmForm model={selectedModel} onClose={handleCloseDeployModal} />
        </div>
      )}
      </div>
  );
};


export default ModelList;
